Documentaire
78 minuten

geregisseerd door Mark Linfield en Alastair Fothergill
met de stem van Tim Allen

Documentaire over chimpansees die leven in de regenwouden van Ivoorkust en Oeganda. Centraal staat de drie jaar jonge chimpansee Oscar en zijn grote familie. Oscar is nieuwsgierig en speels, maar dan raakt hij door omstandigheden zijn familie kwijt en is hij helemaal alleen in de jungle... Zal hij kunnen overleven?



